import React from 'react';
import PropTypes from 'prop-types';
import './DataCard.scss';

const DataCard = props => {
  const { data } = props;
  const cards = data.map(depart => {
    return (
      <div className="col col-12 col-lg-4 col-md-6 mb-3">
        <button
          className="btn h-100 p-3  w-100 border data-card  "
          onClick={depart.actions.handleAction}
        >
          <div className="card-title">{depart.title}</div>
          <div className="card-body">{depart.body}</div>
        </button>
      </div>
    );
  });
  return <div className="row cards">{cards}</div>;
};

DataCard.propTypes = {
  data: PropTypes.array
};

DataCard.defaultProps = {
  data: []
};

export default DataCard;
